private synchronized void setMessageID(PrintStream infoStream) {
  if (infoStream != null && messageID == -1) {
    synchronized(MESSAGE_ID_LOCK) {
      messageID = MESSAGE_ID++;
    }
  }
  this.infoStream = infoStream;
}

